    return (
        <div className='footer-concluidos'>
            <div className='container-botoes'>
                <button type='text'>Não lembrei!</button>
                <button type='text'>Quase lembrei!</button>
                <button type='text'>Zap!</button>
            </div>
            <p>0/4 CONCLUÍDOS</p>
        </div>
    )
}
